    G[9] = W1*det*(K[3]*K[3]*(K[1]*K[7] + K[2]*K[8]) + K[4]*(K[4]*(K[0]*K[6] + K[2]*K[8]) - K[3]*(K[0]*K[7] + K[1]*K[6])) + K[5]*(K[5]*(K[0]*K[6] + K[1]*K[7]) - (K[2]*(K[3]*K[6] + K[4]*K[7]) + K[8]*(K[0]*K[3] + K[1]*K[4]))));
